import React from "react";
import styled from "styled-components";
import NavBar from "../Components/NavBar";
import BackgroundContainer from "../Components/BackgroundContainer";

const Home = () => {
  return (
    <div>
      <BackgroundContainer>
        <h1>안녕하세요</h1>
        <div style={{ postition: sticky }}>
          <NavBar />
        </div>
      </BackgroundContainer>
    </div>
  );
};

export default Home;
